Let the tens digit be $t$ and the units digit be $u$. Then we have the two equations: \begin{align*}
t + u &= 8\\
10u + t - 10t - u &= 18
\end{align*}

Simplifying the second equation, we have $9u - 9t = 18$ or $u-t=2$. Substituting $u = 8-t$ from equation 1, we get $9-2t=2$ or $t=\boxed{\frac{7}{2}}$. However, since $t$ and $u$ must both be integers, this solution is extraneous and there is no solution.
